import { StyleSheet } from 'react-native';

const estiloRotasStack = StyleSheet.create({
   screenLogin: {
      backgroundColor: '#000000'
    },
    screenInicial: {
      backgroundColor: '#92afd7'
    },
    screenColecao: {
      backgroundColor: '#d0f4ea'
    },
    screenItem: {
      backgroundColor: '#d1d1d1'  
    }
});

export default estiloRotasStack;
